CREATE TABLE IF NOT EXISTS banner_message (
  id BIGINT AUTO_INCREMENT PRIMARY KEY,
  content VARCHAR(255)
);

-- 删除现有的bilibili_videos表（如果存在）
DROP TABLE IF EXISTS bilibili_videos;

-- 创建bilibili_videos表
CREATE TABLE bilibili_videos (
  id INT NOT NULL AUTO_INCREMENT,
  title VARCHAR(500),
  up_name VARCHAR(100),
  up_face_url VARCHAR(500),
  view_count INT DEFAULT 0,
  danmaku_count INT DEFAULT 0,
  duration_time VARCHAR(20),
  aid BIGINT,
  bvid VARCHAR(20),
  cid BIGINT,
  publish_time DATETIME,
  cover_url VARCHAR(500),
  video_url VARCHAR(500),
  embed_url TEXT,
  fetch_time DATETIME,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (id)
);


-- 用户表：用于存储用户信息（ID 从 1000 开始自增）
-- 创建users表（如果不存在）
CREATE TABLE IF NOT EXISTS users (
  id BIGINT GENERATED BY DEFAULT AS IDENTITY(START WITH 1000) PRIMARY KEY,
  login_account VARCHAR(100) NOT NULL,
  nickname VARCHAR(100) NOT NULL,
  password VARCHAR(255) NOT NULL,
  avatar_url VARCHAR(500),
  CONSTRAINT uk_users_login_account UNIQUE (login_account)
);

-- 添加新字段（如果不存在）
ALTER TABLE users ADD COLUMN IF NOT EXISTS age INT;
ALTER TABLE users ADD COLUMN IF NOT EXISTS bio TEXT;
ALTER TABLE users ADD COLUMN IF NOT EXISTS join_date DATE DEFAULT CURRENT_DATE;
ALTER TABLE users ADD COLUMN IF NOT EXISTS video_count INT DEFAULT 0;
ALTER TABLE users ADD COLUMN IF NOT EXISTS follower_count INT DEFAULT 0;
ALTER TABLE users ADD COLUMN IF NOT EXISTS following_count INT DEFAULT 0;

